INSERT INTO `v1_07523d8c56472ced2cec97ea4b2e36b45de692cacb785b5a685bc33e07f454ac` VALUES (3, 7, 5, 2, 12300152, 0, 4.19, 1, "はいお疲れ～\n点数的にはまあまあってとこね！\nま、超難問だし頑張ったわよ", 1, 9, "vo_minigame_1012_result_1084", 3001);
INSERT INTO `v1_07523d8c56472ced2cec97ea4b2e36b45de692cacb785b5a685bc33e07f454ac` VALUES (3, 1, 5, 2, 12300153, 0, 0.0, 1, "うん、かなり難しい問題なのに\n最後までやり遂げたわね\n次はもっといい点目指してみる？", 1, 9, "vo_minigame_1012_result_1085", 3001);
INSERT INTO `v1_07523d8c56472ced2cec97ea4b2e36b45de692cacb785b5a685bc33e07f454ac` VALUES (3, 3, 5, 2, 12300154, 0, 2.63, 1, "ちょっとミスが多かったかもね～\nでも間違えた所は復習して\n次は正解するわよー！", 1, 9, "vo_minigame_1012_result_1086", 3001);
INSERT INTO `v1_07523d8c56472ced2cec97ea4b2e36b45de692cacb785b5a685bc33e07f454ac` VALUES (1, 3, 1, 2, 12300155, 0, 5.53, 1, "あら…あんまり良くない点数ね～\nどうしたの、調子でも悪かった？\n次はもっと頑張りましょうか", 1, 4, "vo_minigame_1012_result_1087", 3001);
INSERT INTO `v1_07523d8c56472ced2cec97ea4b2e36b45de692cacb785b5a685bc33e07f454ac` VALUES (1, 3, 1, 2, 12300156, 9, 0.01, 3, "ん～…正解数は\n物足りないわね～\nもうちょっと勉強の時間\n増やしちゃおっか？", 1, 4, "vo_minigame_1012_result_1088", 3001);
