INSERT INTO `v1_07523d8c56472ced2cec97ea4b2e36b45de692cacb785b5a685bc33e07f454ac` VALUES (2, 9, 1, 2, 12300158, 9, 0.01, 9, "ん～今のあんたには、\nこの問題は難しかったかしら…\n難易度下げてチャレンジするのも\nありかもね～？", 1, 4, "vo_minigame_1012_result_1090", 3001);
INSERT INTO `v1_07523d8c56472ced2cec97ea4b2e36b45de692cacb785b5a685bc33e07f454ac` VALUES (2, 3, 1, 2, 12300159, 0, 5.37, 1, "あんまり出来は良くないわね～\n難しい問題だししょうがないけど\n次はもっと頑張ってほしいわ！", 1, 4, "vo_minigame_1012_result_1091", 3001);
